from typing import List
class Solution:
    def uniquePathsWithObstacles(self, obstacleGrid: List[List[int]]) -> int:
        def validSquare(r, c):
            if (0 <= r < rows) and (0 <= c < cols) and (obstacleGrid[r][c] == 0):
                return True
            return False
        def countPaths(r, c):
            if not validSquare(r, c):
                return 0
            #if r == rows - 1 and c == cols - 1:
            #    return 1
            return countPaths(r+1, c) + countPaths(r, c+1)
        def countUniquePaths(r, c):
            if not validSquare(r, c):
                return 0
            #if r == rows - 1 and c == cols - 1:
            #    self.paths[r][c] == 1
            if self.paths[r][c] is not None:
                return self.paths[r][c]
            self.paths[r][c] = countPaths(r+1, c) + countPaths(r, c+1)
            return self.paths[r][c]

        rows = len(obstacleGrid)
        cols = len(obstacleGrid[0])
        self.paths = [[None for _ in range(cols)] for _ in range(rows)]
        self.paths[rows - 1][cols - 1] = 1
        res = countUniquePaths(0, 0)
        return res

